import java.util.ArrayList;
import java.util.List;
import java.util.stream.Collectors;
import java.util.stream.IntStream;
import java.util.stream.LongStream;

public class SpecialStringAgain {

    static class Pair<A,B>{
        A character;
        B count;

        public Pair(A character, B count) {
            this.character = character;
            this.count = count;
        }

        @Override
        public String toString() {
            return "Pair{" +
                    "character=" + character +
                    ", count=" + count +
                    '}';
        }
    }

    static int summation(int n){
        return n*(n+1)/2;
    }

    static long substrCount(int n, String s) {

        s=s.concat("#");
        int count=1;
        List<Pair<Character,Integer>> pairs = new ArrayList<>();
        for (int i = 1; i < n+1; i++) {
            // if current element is equal to previous keep
            // incrementing frequency, else add to pairs list
            if(s.charAt(i)==s.charAt(i-1)) count++;
            else{
                pairs.add(new Pair(s.charAt(i-1),count));
                count=1;
            }
        }

        // 1st option: a,aa,aaa
        // 2nd option: aba, aabaa

        int specialStringCount=0;
        for (int i = 0; i < pairs.size(); i++) {
            specialStringCount += summation(pairs.get(i).count); // 1st
            if(i<pairs.size()-2){
                if((pairs.get(i).character==pairs.get(i+2).character) && pairs.get(i+1).count==1){
                    specialStringCount+= Math.min(pairs.get(i).count,pairs.get(i+2).count); // 2nd
                }
            }
        }
        return specialStringCount;
    }


    public static void main(String[] args) {


        System.out.println(substrCount(4,"asaa"));
        System.out.println(substrCount(5,"asasd"));
        System.out.println(substrCount(4,"aaaa"));
        System.out.println(substrCount(6,"hannah"));
        System.out.println(substrCount(7,"abcbaba"));
        System.out.println(substrCount(8,"mnonopoo"));
        System.out.println(substrCount(55269,""));


    }
}
